import React from 'react';
import { BrowserRouter as Router, Route, Routes, Navigate } from 'react-router-dom';
import Navbar from './components/Navbar';
import Footer from './components/Footer';
import CodingWork from './components/CodingWork';
import Photographs from './components/Photographs';
import 'bootstrap/dist/css/bootstrap.min.css';

function App() {
  return (
    <Router>
      <div className="App">
        <Navbar />
        <div className="container">
          <div className="row">
            {/* Left Column */}
            <div className="col-md-6">
              <div className="about-me-section">
                <h2>About Me</h2>
                <p>Your introduction goes here...</p>
              </div>
              <div className="photographs-section">
                <h2>Photographs</h2>
                <Photographs />
              </div>
            </div>
            {/* Right Column */}
            <div className="col-md-6">
              <div className="animated-image-section">
                <h2>Animated Image</h2>
                {/* Add your animated image here */}
              </div>
            </div>
          </div>
          <div className="row">
            {/* Coding Work Section */}
            <div className="col-md-12">
              <div className="coding-work-section">
                <h2>Coding Work</h2>
                <CodingWork />
              </div>
            </div>
          </div>
        </div>
        <Footer />
      </div>
    </Router>
  );
}

export default App;
